<?php

namespace Database\Seeders;

use Illuminate\Database\Seeder,
    Illuminate\Support\Facades\Hash,
    Illuminate\Support\Str;

use App\Models\User,
    App\Models\Profile,
    App\Models\Avatar;

class AdminSeeder extends Seeder
{
    /**
     * Run the database seeds.
     */
    public function run(): void
    {
        $existingAdmin = User::where('realname', 'admin')->first();

        if ($existingAdmin) {
            $this->command->info('Admin user already exists. Skipping...');
            return;
        }

        $randomPassword = Str::random(32);

        $user = User::create([
            'name' => 'Admin',
            'email' => 'admin@change.me',
            'password' => Hash::make($randomPassword),
            'nick' => 'admin',
            'channels' => 'engineering,help',
            'settings' => [],
        ]);

        $profile = new Profile([
            'bio' => 'System bot profile.',
            'timezone' => 'UTC',
        ]);

        $user->profile()->save($profile);

        $avatar = new Avatar([
            'base64_data' => $this->getAvatarBase64(),
        ]);

        $profile->avatars()->save($avatar);

        $profile->selected_avatar_id = $avatar->id;
        $profile->save();

        $this->command->info('Admin user, profile, and avatar created.');
    }

    /**
     * Returns the base64 data string for the admin avatar.
     */
    private function getAvatarBase64(): string
    {
        return <<<BASE64
data:image/png;base64,
BASE64;
    }
}
